Coke Kings and Queens

Health-Medical Documentary hosted by Andres Williams, published by National Geographic broadcasted as part of NG Drugs Inc series in 2012 - English narration


Information
------------------------------

Drugs Inc: Coke Kings and Queens
In London, dubbed the &quot;cocaine capitol of Europe, drug lords are experiencing a boom in homegrown marijuana that has turned Britain into an exporting country. While cocaine is the preferred drug for upper- and middle-class Londoners, in the tough housing projects of East London, marijuana reigns as king.

